import * as React from 'react';
import { useState } from 'react';
import { Box } from '@mui/system';
import Grid from '@mui/material/Grid';
import { Button, Collapse, Alert, IconButton } from '@mui/material';
import TextField from '@mui/material/TextField';
import axios from 'axios';
import { variables } from '../Variables';
import { Link } from 'react-router-dom';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import CloseIcon from '@mui/icons-material/Close';

const EmployeeAdd = () => {
    const[newEmployee, setEmployee] = useState({});
    const [successOpen, setSuccessOpen] = useState(false);

    const handleChange = (e) => {
        const {name, value} = e.target;
        console.log(e);
        setEmployee({ ...newEmployee, [name]: value });
    }

    const handleSubmit = (e) => {
        e.preventDefault();
        addEmployee();
    }

    const addEmployee = async () => {
            await axios.post(`${variables.API_URL}/Employee`, {
                id: 0,
                firstName: newEmployee.firstName,
                lastName: newEmployee.lastName,
                compensationType: newEmployee.compensationType
            });
    }

    return (
        <Box>
                        <Collapse in={successOpen}>
                <Alert
                    action={
                        <IconButton
                            aria-label="close"
                            color="inherit"
                            size="small"
                            onClick={() => {
                                setSuccessOpen(false);
                            }}>
                            <CloseIcon fontSize="inherit" />
                        </IconButton>
                    }
                    sx={{ mb: 2 }}>
                    Sucessfully Submitted
                </Alert>
            </Collapse>
            <Grid item xs={12} sx={{ display: 'flex' }}>
                <div>
                    <Link to="/employees" ><Button startIcon={<ArrowBackIcon />} size="large">Go Back</Button></Link>
                </div>
            </Grid>
            <h1>Add Employee</h1>
            <form onSubmit={handleSubmit}>
            <Grid container spacing={3}>
                <Grid item xs={12}>
                    <TextField
                        required
                        id="outlined-required"
                        label="First Name"
                        name="firstName"
                        defaultValue=""
                        onChange={handleChange}
                    />
                </Grid>
                <Grid item xs={12}>
                    <TextField
                        required
                        id="outlined-required"
                        label="Last Name"
                        name="lastName"
                        defaultValue=""
                        onChange={handleChange}
                    />
                </Grid>
                <Grid item xs={12}>
                        <Button variant="contained" color="success" type="submit">Submit</Button>
                </Grid>
            </Grid>
            </form>
        </Box>
    );
}

export default EmployeeAdd;
